import {FETCH_REPORT_BY_PLAYER_USERNAME} from './actionType'


const initialState = {
    reportsOfPlayer: [{
    }]
};

const reportReducers = (state = initialState,action) => {
    switch(action.type) {
        case FETCH_REPORT_BY_PLAYER_USERNAME:
            return {
                ...state,
                reportsOfPlayer: action.payload
            }
        default:
            return state;
    }
}

export default reportReducers;
